var App = App || {};

App.constants = {
  ITEM_ADD: "ITEM_ADD",
  ITEM_ADD_SUCCESS: "ITEM_ADD_SUCCESS",
  ITEM_ADD_FAILURE: "ITEM_ADD_FAILURE",

  ITEM_UPDATE: "ITEM_UPDATE",
  ITEM_UPDATE_SUCCESS: "ITEM_UPDATE_SUCCESS",
  ITEM_UPDATE_FAILURE: "ITEM_UPDATE_FAILURE",

  ITEM_DELETE: "ITEM_DELETE",
  ITEM_DELETE_SUCCESS: "ITEM_DELETE_SUCCESS",
  ITEM_DELETE_FAILURE: "ITEM_DELETE_FAILURE",

  LIST_UPDATE: "LIST_UPDATE",
  LIST_UPDATE_SUCCESS: "LIST_UPDATE_SUCCESS",
  LIST_UPDATE_FAILURE: "LIST_UPDATE_FAILURE",

  LIST_TAGS_UPDATE: "LIST_TAGS_UPDATE",
  LIST_TAGS_UPDATE_SUCCESS: "LIST_TAGS_UPDATE_SUCCESS",
  LIST_TAGS_UPDATE_FAILURE: "LIST_TAGS_UPDATE_FAILURE",

  LIST_TAG_REMOVE: "LIST_TAG_REMOVE_UPDATE",
  LIST_TAG_REMOVE_SUCCESS: "LIST_TAG_REMOVE_SUCCESS",
  LIST_TAG_REMOVE_FAILURE: "LIST_TAG_REMOVE_FAILURE"
};
var FluxMixin       = Fluxxor.FluxMixin(React);
var StoreWatchMixin = Fluxxor.StoreWatchMixin;
App.actions = {
  listItem: {
    update: function(itemData, newItemData) {
      var payload = {
        itemData: itemData,
        newItemData: newItemData
      };

      this.dispatch(App.constants.ITEM_UPDATE, payload);
      App.updateItem(
        payload,
        function(data) {
          this.dispatch(App.constants.ITEM_UPDATE_SUCCESS, data);
        }.bind(this),
        function(payload) {
          this.dispatch(App.constants.ITEM_UPDATE_FAILURE, payload);
        }.bind(this)
      );
    },

    updateMultiple: function() {
      console.log('updateMultiple');
    },

    add: function(itemData) {
      var listID = this.flux.store("ListStore").getID();
      var listItemID = App.makeId();
      itemData.list_id = listID;
      itemData.listItemID = listItemID;
      App.saveItem(
        itemData,
        function(newItemData) {
          this.dispatch(App.constants.ITEM_ADD, newItemData);
        }.bind(this)
      );
    },

    delete: function(itemId) {
      this.dispatch(App.constants.ITEM_DELETE, itemId);
      App.deleteItem(itemId);
    },

    addToUiOnly: function(itemData) {
      this.dispatch(App.constants.ITEM_ADD, itemData);
    }
  },
  list: {
    update: function(listData) {
      // console.log('Action: list::update()', listData);
      this.dispatch(App.constants.LIST_UPDATE, listData.newData);
      listData.newData.listId = this.flux.store("ListStore").getID();
      App.updateList(
        listData.newData,
        function(data) {
          this.dispatch(App.constants.LIST_UPDATE_SUCCESS, data);
        }.bind(this),
        function(error) {
          listData.error = error;
          this.dispatch(App.constants.LIST_UPDATE_FAILURE, listData);
        }.bind(this)
      );
    },

    updateTags: function(newTagData) {
      // console.log('updateTags', newTagData);
      this.dispatch(App.constants.LIST_TAGS_UPDATE);
      App.updateTags(
        newTagData,
        function(data) {
          this.dispatch(App.constants.LIST_UPDATE_SUCCESS, data);
        }.bind(this),
        function(error) {
          this.dispatch(App.constants.LIST_TAGS_UPDATE_FAILURE);
        }.bind(this)
      );
    },

    removeTag: function(tagToRemove) {
      console.log('delete', tagToRemove);
      this.dispatch(App.constants.LIST_TAG_REMOVE);
      App.removeTag(
        tagToRemove,
        function(data) {
          // console.log('remove success', data);
          this.dispatch(App.constants.LIST_TAG_REMOVE_SUCCESS, data);
        }.bind(this),
        function(error) {
          // console.log('error remove', error);
          this.dispatch(App.constants.LIST_TAG_REMOVE_FAILURE);
        }.bind(this)
      );
    }
  }
};
App.listStore = Fluxxor.createStore({
  initialize: function (options) {
    this.list = options.list || [];
    this.itemsToSave = [];
    this.bindActions(App.constants.ITEM_UPDATE, this.onUpdateItem, App.constants.ITEM_UPDATE_SUCCESS, this.onUpdateItemSuccess, App.constants.ITEM_UPDATE_FAILURE, this.onUpdateItemFailure, App.constants.ITEM_ADD, this.onItemAdd, App.constants.ITEM_DELETE, this.onItemDelete, App.constants.LIST_UPDATE, this.onListUpdate, App.constants.LIST_UPDATE_SUCCESS, this.onListUpdateSuccess, App.constants.LIST_UPDATE_FAILURE, this.onListUpdateFailure, App.constants.LIST_TAGS_UPDATE, this.onListTagsUpdate, App.constants.LIST_TAGS_UPDATE_SUCCESS, this.onListTagsUpdateSuccess, App.constants.LIST_TAGS_UPDATE_FAILURE, this.onListTagsUpdateFailure, App.constants.LIST_TAG_REMOVE, this.onListTagRemove, App.constants.LIST_TAG_REMOVE_SUCCESS, this.onListTagRemoveSuccess, App.constants.LIST_TAG_REMOVE_FAILURE, this.onListTagRemoveFailure);
  },

  getID: function () {
    return this.list.id;
  },

  getState: function () {
    return {
      list: this.list,
      listDetails: this.list,
      listTags: this.list.tags,
      listItems: this.list.list_items,
      itemsToSave: this.itemsToSave
    };
  },

  onListUpdate: function (data) {
    console.log('storeList: onListUpdate', data);
  },

  onListUpdateSuccess: function (data) {
    this.list = data;
    this.emit('change');
    toastr.success('List was updated successfully.');
  },

  onListUpdateFailure: function (data) {
    this.list.title = data.oldData.title;
    this.list.description = data.oldData.description;
    this.emit('change');
  },

  onUpdateItem: function (payload) {
    var list_items = this.list.list_items;
    for (var i = 0; i < list_items.length; i++) {
      var listItem = list_items[i];
      if (listItem.id === payload.itemData.id) {
        list_items[i] = payload.newItemData;
        list_items[i].isSaving = true;
        break;
      }
    }
    this.emit('change');
    toastr.success('Item was updated successfully.');
  },

  onUpdateMultipleItems: function (payload) {
    console.log('onUpdateMultipleItems');
    //
    // this.emit('change');
  },

  onUpdateItemSuccess: function (payload) {
    var list_items = this.list.list_items;
    for (var i = 0; i < list_items.length; i++) {
      var listItem = list_items[i];
      if (listItem.id === payload.id) {
        list_items[i].isSaving = false;
        break;
      }
    }
    this.emit('change');
  },

  onUpdateItemFailure: function (payload) {
    console.log(payload);
    var list_items = this.list.list_items;
    for (var i = 0; i < list_items.length; i++) {
      var listItem = list_items[i];
      if (listItem.id === payload.itemData.id) {
        list_items[i] = payload.itemData;
        list_items[i].isSaving = false;
        alert("Error saving changes. Error message: " + payload.error);
        break;
      }
    }
    this.emit('change');
  },

  onItemAdd: function (payload) {
    this.list.list_items.push(payload);
    this.emit('change');
    toastr.success('Item was added to your list.');
  },

  onItemDelete: function (itemId) {
    for (var i = 0; i < this.list.list_items.length; i++) {
      var listItem = this.list.list_items[i];
      if (listItem.id === itemId) {
        this.list.list_items.splice(i, 1);
        break;
      }
    }

    this.emit('change');
    toastr.success('Item was removed from your list.');
  },

  onListTagsUpdate: function () {
    // this.list.isSaving = true;
    this.emit('change');
  },

  onListTagsUpdateSuccess: function (newListData) {
    console.log('onListTagsUpdate', newListData);
    this.list = newListData;
    this.list.isSaving = false;
    this.emit('change');
  },

  onListTagsUpdateFailure: function () {
    console.warn('Error saving tags to list.');
    this.list.isSaving = false;
    this.emit('change');
  },

  onListTagRemove: function () {
    this.list.isSaving = true;
    this.emit('change');
  },

  onListTagRemoveSuccess: function (newListData) {
    console.log('onListTagRemoveSuccess', newListData);
    this.list = newListData;
    this.list.isSaving = false;
    this.emit('change');
  },

  onListTagRemoveFailure: function () {
    console.warn('Error removing tag to list.');
    this.list.isSaving = false;
    this.emit('change');
  }
});
